import "./styles/Loader.css";
const Loader = () => {
  // console.log(styles);
  return (
    <>
      <div className="flex justify-center ">
        <div class="loader-wrapper-1">
          <div class="loader-1">
            <div class="loader-1 loader-inner-1"></div>
          </div>
        </div>
      </div>
    </>
  );
};

